import React from 'react'

import classes from './styles.module.css'

const Modal = ({ active, setActive, children, openPage }) => {
    console.log(children, 'children')
    return (
        <div className={active ? [classes.modal, classes.modalActive].join(" ") : classes.modal} onClick={() => setActive(false)}>
            <div className={classes.modalContent} onClick={e => e.stopPropagation()}>
                {/* <div className={classes.elemModal}>{children}</div> */}
                <div className={classes.elemModal}>
                    {children.map((item, i) => (
                        <span
                            key={i}
                            className={classes.chooseLink}
                            onClick={() => openPage(item)}
                        >
                            {item}
                        </span>
                    ))}
                </div>
                <div>Увійти</div>
            </div>

        </div>
    )
}

export default Modal
